import React, { useState, useEffect } from 'react';
import { Layout, Menu, Form, Input, Button, Row, Col, Card } from 'antd';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Element, Link as ScrollLink } from 'react-scroll';
import Login from './Login';
import Logout from './Logout';
import PropertyInputPage from './PropertyInputPage';
import PropertyList from './PropertyList';
import PropertyDetail from './PropertyDetail';
import Home from './Home';
import Contact from './Contact';

const { Header, Content, Footer } = Layout;
const { Meta } = Card;

const HomePage = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [properties, setProperties] = useState([]);
  const [currentProperty, setCurrentProperty] = useState(null);

  useEffect(() => {
    const storedProperties = JSON.parse(localStorage.getItem('properties'));
    if (storedProperties) {
      setProperties(storedProperties);
    }
  }, []);

  useEffect(() => {
    localStorage.setItem('properties', JSON.stringify(properties));
  }, [properties]);

  const handleNewProperty = (property) => {
    setProperties((prevProperties) => [...prevProperties, property]);
    setCurrentProperty(null); // Clear current property after adding new
  };

  const handleDeleteProperty = (id) => {
    setProperties((prevProperties) => prevProperties.filter(property => property.id !== id));
  };

  const handleEditProperty = (property) => {
    setCurrentProperty(property);
  };

  const handleUpdateProperty = (updatedProperty) => {
    setProperties((prevProperties) => 
      prevProperties.map(property => property.id === updatedProperty.id ? updatedProperty : property)
    );
    setCurrentProperty(null); // Clear current property after updating
  };

  return (
    <Router>
      <Layout className="layout">
        <Header>
          <div className="logo" />
          <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']}>
            <Menu.Item key="1">
              <Link to="/">Ana Sayfa</Link>
            </Menu.Item>
            <Menu.Item key="2">
              <Link to="/property-list">Emlak Listesi</Link>
            </Menu.Item>
            <Menu.Item key="3">
              <ScrollLink to="contact" smooth={true} duration={500}>İletişim</ScrollLink>
            </Menu.Item>
            {isLoggedIn ? (
              <Menu.Item key="4">
                <Link to="/logout">Çıkış Yap</Link>
              </Menu.Item>
            ) : (
              <Menu.Item key="4">
                <Link to="/login">Giriş Yap</Link>
              </Menu.Item>
            )}
          </Menu>
        </Header>
        <Content style={{ padding: '0' }}>
          <Element name="home">
            <div style={{ 
              backgroundImage: 'url(https://izcelikyapi.com/wp-content/uploads/2022/05/iki-katli-celik-ev-modelleri.webp)', 
              height: '100vh', 
              backgroundSize: 'cover', 
              backgroundPosition: 'center', 
              display: 'flex', 
              justifyContent: 'center', 
              alignItems: 'center',
              width: '100vw'
            }}>
              <Form layout="inline" style={{ background: 'rgba(0, 0, 0, 0.5)', padding: '20px', borderRadius: '10px' }}>
                <Form.Item>
                  <Input placeholder="Tür" />
                </Form.Item>
                <Form.Item>
                  <Input placeholder="İl" />
                </Form.Item>
                <Form.Item>
                  <Input placeholder="İlçe" />
                </Form.Item>
                <Form.Item>
                  <Input placeholder="Oda Sayısı" />
                </Form.Item>
                <Form.Item>
                  <Button type="primary">Search</Button>
                </Form.Item>
              </Form>
            </div>
          </Element>
          <Element name="properties">
            <div style={{ padding: '50px 0' }}>
              <h2 style={{ textAlign: 'center' }}>Eklenen Evler</h2>
              <Row gutter={[16, 16]}>
                {properties.map((property) => (
                  <Col span={8} key={property.id}>
                    <Link to={`/property/${property.id}`}>
                      <Card
                        hoverable
                        cover={<img alt="property" src={property.image} />}
                      >
                        <Meta title={property.title} description={property.description} />
                      </Card>
                    </Link>
                  </Col>
                ))}
              </Row>
            </div>
          </Element>
          <Element name="contact">
            <div style={{ padding: '50px 0', textAlign: 'center' }}>
              <h2>İletişim</h2>
              <Form layout="vertical" style={{ maxWidth: '600px', margin: '0 auto' }}>
                <Form.Item label="Ad Soyad">
                  <Input placeholder="Adınızı ve Soyadınızı girin" />
                </Form.Item>
                <Form.Item label="Email">
                  <Input type="email" placeholder="Email adresinizi girin" />
                </Form.Item>
                <Form.Item label="Mesaj">
                  <Input.TextArea rows={4} placeholder="Mesajınızı girin" />
                </Form.Item>
                <Form.Item>
                  <Button type="primary" htmlType="submit">Gönder</Button>
                </Form.Item>
              </Form>
            </div>
          </Element>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login setIsLoggedIn={setIsLoggedIn} />} />
            <Route path="/logout" element={<Logout setIsLoggedIn={setIsLoggedIn} />} />
            <Route path="/property-input" element={
              <PropertyInputPage 
                onNewProperty={handleNewProperty}
                onUpdateProperty={handleUpdateProperty}
                currentProperty={currentProperty} 
              />
            } />
            <Route path="/property-list" element={
              <PropertyList 
                properties={properties} 
                onDeleteProperty={handleDeleteProperty}
                onEditProperty={handleEditProperty}
              />
            } />
            <Route path="/property/:id" element={<PropertyDetail properties={properties} />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </Content>
        <Footer style={{ textAlign: 'center' }}>Emlakçı Otomasyonu ©2024 Created by You</Footer>
      </Layout>
    </Router>
  );
};

export default HomePage;
